    string json = "{ \"key1\": { \"key1.1\": \"value\", \"key1.2\": 3, \"key1.3\": true } }";

    constructor() public{

    }

    function check(string memory jsonx) public returns (uint){

        uint returnCode;
        JsmnSolLib.Token[] memory tokens;
